What would you buy if you only had a sober penny?
And what would you not if you had a lot more? 

What and a lot are untidy rhymes of our every day parade
Hardly fulfilling north of only a never ending sky

In our race of things, we forget the why
We embrace an early greed, and also forget the how

An opportunist knows,
And hence never goes searching, he waits
patiently and in peace for his when and where
