When I first started managing online course launches, I had a team of 10 to delegate to. I would often tell myself things that I later realized were extremely common among multi-talented online entrepreneurs.⁠
.⁠
🗣 “I can do it better myself.”⁠
.⁠
🗣 “It would take me less time to do it myself than to teach someone how to do it... so I’ll just do it.”⁠
.⁠
Delegating was HARD!⁠
.⁠
Usually there are areas so outside of your expertise as a business owner that you can easily delegate them. Maybe the tech and graphics aren’t your strong suit so you delegate those every single time. But there are usually 1 to 2 areas that you’re pretty good at, maybe even great at, that you are putting off delegating to other people because of the learning curve or impatience.⁠
.⁠
And that’s holding you back!⁠
.⁠
On the blog, we talked all about how YOU can learn to delegate as a control freak. (Written by me, a recovering control freak!)⁠
.⁠
